import { Outlet } from 'react-router-dom';
import MainNavigation from '../components/MainNavigation';

const GnbRoot = () => {
	return (
		<>
			<MainNavigation />
			<Outlet />
		</>
	);
};

const EventRoot = () => {
	return <div>Component</div>;
};

export { GnbRoot, EventRoot };
